import React from "react";

const BillsList = props => {
  return (
    <div className="bills-list">
      <h2>Bills</h2>
      <table>
        <tr>
          <td>7/3/18</td>
          <td>Chicago Hotel</td>
          <td>Jim Jolly paid $65.30</td>
          <td>Jim lent you $32.65</td>
        </tr>
        <tr>
          <td>10/13/18</td>
          <td>Southwest ticket to Las Vegas</td>
          <td>You paid $265.30</td>
          <td>Crhis Mowry owes you $132.65</td>
        </tr>
      </table>
    </div>
  );
};

export default BillsList;
